const RestroCard=({
    name,
    cloudinaryImageId,
    cuisines,
    avgRating
})=>{
    return(
        <div className="Card">
            <img
            src={"https://res.cloudinary.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_660,c_fill/"+cloudinaryImageId}

            />
            <h2>{name}</h2>
            <h3>
            {cuisines.join(",")} 
            </h3>
            <h4>{avgRating}⭐</h4>
        </div>
    );
}




const Body=()=>{
    return(
        <div className="restronent-list">
            
          {restorent_list.map((resttorent)=>{
            return <RestroCard {...resttorent.info} key={resttorent.info.id}/>;
          })}
            
            

        </div>
    );
}
const Footer=()=>{
    return(
        <h4>Footer</h4>
    );
}


const AppLayout=()=>{
    return(
       /* //header
            logo
            nav items
            cart
        //Body
        // -search bar
        // -retsorent linst
        //    -restorent card
        //      -image
        //      -name
        //      -rating
        //      - cusines

        footer
            links
            copyright
        */
       <>
        <HeaderContent/>
       <Body/>
       <Footer/>
       </>
    );
}



const root=ReactDOM.createRoot(document.getElementById("root"));


//async defer
root.render(<AppLayout/>);
